INSERT INTO `email_templates` VALUES(8, 'TOR Browser', '{Employee_Name} / TOR Browser', '<p>{Manager_Name},</p>\r\n<p>According to NextHRM, the resource <strong>{Employee_Name}</strong> (EmployeeID {Employee_Id}) is working under your management. He is using TOR Browser which is not allowed.</p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">{Employee_Id}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>{Employee_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>{Manager_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>{Employee_Location}</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>{Employee_Sitting_Hall}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>According to our monitoring tools, the user is using TorBrowser to evade our local rules. Please address the severe disciplinary issue with the resouce as soon as possible and intimate us of the outcomes of the meeting.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC resource.</p>', '0000-00-00 00:00:00', 1, '2014-05-22 13:07:10', 1);
